import React from 'react';


const Header = () => {
    return (
        <header className="header">
            <img className="logo" alt="logo" src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e7/Instagram_logo_2016.svg/768px-Instagram_logo_2016.svg.png"></img>
        </header>
    )
}

export default Header;
